const Main = () => {
  const array = [
    1, 2, 3, 45, 4, 2423, 423, 424, 324, 24, 23, 2534, 3, 4, 245, 435, 232,
  ];

  const data = {
    items: [
      {
        name: "name",
        likes: 21,
      },
      {
        name: "name2",
        likes: 44,
      },
    ],
  };

  return (
    <>
      <main>
        <div className="main-container">
          <div className="result-container">
            <div className="result-pagination">
              <div className="result-pag-item">Option1</div>
              <div className="result-pag-item">Option2</div>
              <div className="result-pag-item">Option3</div>
            </div>
            <div className="result-grid">
              {data.id.map((element) => (
                <div className="result-grid-element">{element[1].date}</div>
              ))}
            </div>
          </div>
        </div>
      </main>
    </>
  );
};

export default Main;
